import React from 'react';
import products from '../assets/product';

const ProductGrid = ({ category, size, style, onAddToCart }) => {
  const filteredProducts = products.filter((product) => {
    const matchCategory = category ? product.category === category : true;
    const matchSize = size ? product.size === size : true;
    const matchStyle = style ? product.style === style : true;
    return matchCategory && matchSize && matchStyle;
  });

  return (
    <div style={{ 
      display: 'flex', 
      gap: '40px', 
      flexWrap: 'wrap', 
      justifyContent: 'flex-start',
      padding: '0'
    }}>
      {filteredProducts.length === 0 ? (
        <p style={{ fontSize: '16px', color: '#6b7280' }}>No products match the selected filters.</p>
      ) : (
        filteredProducts.map((product) => (
          <div
            key={product.id}
            style={{
              border: 'none',
              borderRadius: '0',
              padding: '0',
              width: '230px',
              textAlign: 'center',
              backgroundColor: 'transparent',
              boxShadow: 'none',
              fontFamily: '-apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif'
            }}
          >
            {/* Product Image/Color Block */}
            <div
              style={{
                backgroundColor: product.color,
                height: '280px',
                marginBottom: '16px',
                borderRadius: '8px',
                position: 'relative',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                boxShadow: '0 1px 3px rgba(0, 0, 0, 0.12), 0 1px 2px rgba(0, 0, 0, 0.24)'
              }}
            >
              {/* Category label overlay */}
              <div style={{
                position: 'absolute',
                bottom: '20px',
                left: '50%',
                transform: 'translateX(-50%)',
                backgroundColor: 'rgba(255, 255, 255, 0.95)',
                padding: '8px 16px',
                borderRadius: '4px',
                fontSize: '14px',
                fontWeight: '500',
                color: '#374151',
                minWidth: '60px'
              }}>
                {product.category}
              </div>
            </div>

            {/* Product Name */}
            <h3 style={{ 
              margin: '0 0 8px 0', 
              fontSize: '18px', 
              fontWeight: '400', 
              color: '#1f2937',
              lineHeight: '1.3'
            }}>
              {product.name}
            </h3>

            {/* Product Price */}
            <p style={{ 
              fontWeight: '600', 
              fontSize: '18px', 
              color: '#2563eb', 
              margin: '0 0 20px 0'
            }}>
              ${product.price}
            </p>

            {/* Add to Cart Button */}
            <button
              onClick={() => onAddToCart(product)}
              style={{
                backgroundColor: '#2563eb',
                color: '#ffffff',
                border: 'none',
                padding: '14px 0',
                borderRadius: '6px',
                cursor: 'pointer',
                fontWeight: '600',
                width: '100%',
                fontSize: '14px',
                transition: 'all 0.15s ease-in-out',
                fontFamily: 'inherit'
              }}
              onMouseOver={(e) => {
                e.target.style.backgroundColor = '#1d4ed8';
              }}
              onMouseOut={(e) => {
                e.target.style.backgroundColor = '#2563eb';
              }}
            >
              Add to Cart
            </button>
          </div>
        ))
      )}
    </div>
  );
};

export default ProductGrid;
